import React from "react";

const Orders = ({ orderid }) => {
  return (
    <div className="order d-flex">
      <h1 className="bold-text">view all orders</h1>
      <div className="order-info d-flex flex-row">
        <div className="order-id">
          <span>Order ID : </span>
          <span>{orderid}</span>
        </div>
        <div className="date-time">
          <p>8-October, 2021 | 13:53</p>
        </div>
      </div>
      <div className="more-info d-flex flex-row">
        <h4>Buyer’s Name : Rishabh Rawat</h4>
        <h4>Purchsed worth : ₹ 4960.00</h4>
        <h4>Items : 4</h4>
      </div>
    </div>
  );
};

export default Orders;
